import React, { useEffect, useState } from 'react';
import CreateMint from './CreateMint';
import MintList from './MinList';

interface Mint {
    id: number;
    name: string;
    description: string;
}

const MintComponent: React.FC = () => {
    const [mints, setMints] = useState([]);

    const mockMints: Mint[] = [
        {
            id: 1,
            name: 'Mint 1',
            description: 'This is mint 1',
        },
        {
            id: 2,
            name: 'Mint 2',
            description: 'This is mint 2',
        },
        {
            id: 3,
            name: 'Mint 3',
            description: 'This is mint 3',
        },
    ];

    useEffect(() => {
        // Call API to fetch mints
        fetch('https://api.example.com/mints')
            .then(response => response.json())
            .then(data => setMints(data))
            .catch(error => console.error(error));
    }, []);

    return (
        <div>
            <CreateMint />
            <MintList mints={mockMints} />
        </div>
    );
};

export default MintComponent;
